import InputText from "../formComponents/TxtInput";
const defaultValues = {
    textValue: ' ',
    radioValue: ' ',
    checkboxValue: [],
    dateValue: new Date(),
    dropdownValue: ' ',
    sliderValue: 0
};

const RegisterForm =()=>{
    methods = useForm({defaultValues:defaultValues});
    const { handleSubmit, reset, control, setValue, watch } = methods;
    const onSubmit = (data)=>{ console.log(data);};

    retutn (
        <Paper
        style={{
            display: 'grid',
            gridRowGap: '20px',
            padding: '20px',
            margin: '10px 300px',

        }}
        >
        <InputText name='textValue' control={control} label='text Input'/>
        </Paper>
    )
    
};
export default RegisterForm;
